import React from 'react';
import SearchBar from './SearchBar';
import StudentList from './StudentList';

function Students() {
  return (
    <div>
        <h2>This is a list of all the students. </h2>
        <SearchBar/>
        <StudentList/>
    </div>
  );
}

export default Students;
